				<td class="col1">用户：</td>
				<td class="col2">
					<input type='text' name='text_ftp_username' id='text_ftp_username' maxlength="32" style="width:200px" />（可选）
				</td>
			</tr>
			<tr class="tr_ftp">
				<td class="col1">密码：</td>
				<td class="col2">
					<input type='password' name='text_ftp_password' id='text_ftp_password' maxlength="32" style="width:200px" />（可选） 
				</td>
			</tr>
			<tr class="tr_tftp">
				<td class="col1">TFTP服务器：</td>
				<td class="col2">
					<input type='text' name='text_tftp_server' id='text_tftp_server' style="width:200px" maxlength="64" /> （1-64个字符）
				</td>
			</tr>
			<tr class="tr_tftp">
				<td class="col1">文件名：</td>
				<td class="col2">
					<input type='text' name='text_tftp_cfgName' id='text_tftp_cfgName' style="width:200px" maxlength="32" value="syslog.log" />（1-32个字符）
				</td>
			</tr>
			
		</table>
		<div class="content_option">
			<input class="buttonL" onclick="exportCfg();" type="button" value="导 出" />
		</div>
	</div>
	
	<!-- end -->
</body>
